import React, { useEffect, useState } from 'react'
import CreateIcon from '@mui/icons-material/Create';
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import WorkIcon from '@mui/icons-material/Work';
import PhoneAndroidIcon from '@mui/icons-material/PhoneAndroid';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import { NavLink, useParams,  useNavigate } from 'react-router-dom';
import { deldata } from './context/ContextProvider'

const Details = () => {

    const [getuserdata, setUserdata] = useState([]);
    console.log(getuserdata);
    const {dltdata, setDLTdata} = useContext(deldata);

    const { id } = useParams("");
    console.log(id);

    const Navigate = useNavigate();


    const getdata = async () => {

        const res = await fetch(`/getuser/${id}`, {
            method: "GET",
            headers: {
                "Content-Type": "application/json"
            }
        });

        const data = await res.json();
        console.log(data);

        if (res.status === 422 || !data) {
            console.log("error ");

        } else {
            setUserdata(data)
            console.log("get data");
        }
    }

    useEffect(() => {
        getdata();
    }, [])

    const deleteuser = async (id) => {

        const res2 = await fetch(`/deleteuser/${id}`, {
            method: "DELETE",
            headers: {
                "Content-Type": "application/json"
            }
        });

        const deletedata = await res2.json();
        console.log(deletedata);

        if (res2.status === 422 || !deletedata) {
            console.log("error");
        } else {
            console.log("user deleted");
            Navigate("/");
        }

    }
    useEffect(() => {
      if (dltdata) {
          const timer = setTimeout(() => {
              setDLTdata(null); // Clear the alert after 1 second
          }, 1000);
    
          return () => clearTimeout(timer); // Clear the timer on component unmount
      }
    }, [dltdata, setDLTdata]);



    return (
        <div className="container mt-3">
            <h1 style={{ fontWeight: 400 }}>Welcome {getuserdata.name}</h1>

            <Card sx={{ maxWidth: 600 }}>
                <CardContent>
                    <div className="add_btn">
                        <NavLink to={`/edit/${getuserdata._id}`}>  <button className="btn btn-primary mx-2"><CreateIcon /></button></NavLink>
                        <button className="btn btn-danger" onClick={() => deleteuser(getuserdata._id)}><DeleteOutlineIcon /></button>
                    </div>
                    <div className="row">
                        <div className="left_view col-lg-6 col-md-6 col-12">
                        <img src="https://img.freepik.com/premium-vector/man-avatar-profile-picture-vector-illustration_268834-538.jpg"  style={{width:70 }}/>
                        <h3 className='mt-3'>Name: <span> {getuserdata.name} </span></h3>
              <h3 className='mt-3'>Age: <span> {getuserdata.age} </span></h3>
                <p className='mt-3'><MailOutlineIcon/> Email: <span>{getuserdata.email}</span></p>
                 <p className='mt-3'><WorkIcon/> Occupation: <span>{getuserdata.work}</span></p>

                </div>
               <div className="right_view col-lg-6 col-md-6 col-12 mt-5">
                     <p className='mt-5'><LocationOnIcon/> location: <span>{getuserdata.add}</span></p>
                     <p className='mt-3'><PhoneAndroidIcon/> mobile: <span>{getuserdata.mobile}</span></p>
                     <p className='mt-3'>Description:<span>{getuserdata.desc}</span> </p>

                 </div>
                 </div>
           </CardContent>
         </Card>
        </div>
    )
}

export default Details
